//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

//importao de bilioteca, a qual ir fornecer funes herdadas de um contrato
//o qual ir possibilitar a realizao de transaes
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
// Contrato inteligente / Smart contract
contract MeuContrato {
    
    // Armazena a quantidade de usurios atualmente no contrato
    uint public quantUsuario;
    
    // Armazena a quantidade mnima e mxima de usurios permitida por contrato
    uint public minPessoas;
    uint public maxPessoas;
    
    // Armazena a taxa de administrao do contrato
    uint public taxaAdmin;
        
    //referente a user stories de nmero 5, as variveis abaixo suprem partes dos requisitos desta user storie, ao definir uma carteira central para receber as taxas de administrao do contrato.
    // Carteira central que ir armazenar informaes sobre a carteira da *Coover*
    address carteiraCentral;
    uint fundosAdm;

    // Armazena a lista de carteiras de usurios
    Carteira[] public carteira;
    
    // Estrutura para armazenar a Carteira de um *Usurio*
    struct Carteira {
        address carteiraUsuario;
        uint valorAparelho;
        uint saldo;
    }
    
    // Endereo do proprietrio do contrato, que  o ADMINISTRADOR [IMPORTANTE: apenas o proprietrio pode adicionar e remover usurios]
    address admin; // nota-se que encurtamos o nome para ser melhor para o cdigo.
    
    // Construtor do contrato que define a quantidade mnima e mxima de usurios, alm de definir o dono do contrato e a taxa de administrao
    constructor(uint _minPessoas, uint _maxPessoas, uint _taxaAdmin) { 
        quantUsuario = 0;
        admin = msg.sender;
        minPessoas = _minPessoas;
        maxPessoas = _maxPessoas;
        taxaAdmin = _taxaAdmin;
        carteiraCentral = payable(msg.sender);
        fundosAdm = 0;
    }
        
        //referente a user storie de nmero 4, o cdigo abaixo supre a user stories de nmero 4, pois ao criar o modificador 'apenasAdmin' que cede a permisso,
        //apenas ao dono do contrato / proprietrio.  possvel criar o nvel de permisso que o gerente de seguros precisa, que  prevista na user storie.
        //modificador que da a permisso apenas para o dono do contrato executar uma funo
        modifier apenasAdmin() {
        require(msg.sender == admin, "Somente o proprietario do contrato pode executar esta funcao.");
        _;
    }
    
    // Adicionar um novo usurio ao projeto
    function adicionarUsuario(address cliente,uint valorAssegurado) public apenasAdmin {
        
        // Verifica se a quantidade mxima de usurios j foi atingida
        require(quantUsuario <= maxPessoas, "O numero maximo de usuarios ja foi atingido.");
        
        // Adiciona o usurio  lista de carteiras com seu saldo e valor do aparelho celular
        carteira.push(Carteira(payable(cliente), valorAssegurado, 0));
        
        // Incrementa a quantidade de usurios
        quantUsuario++;
    }
    
    //funo para uma carteira adicionar dinheiro no smart contract
    function adicionarDinheiro() public payable{
        
        //armazena a taxa do adminstrador
        uint taxa = taxaAdmin;
        
        //armazena o valor do deposito
        uint valorDeposito = msg.value;
        
        //armazena o valor que o suario deve receber, uma vez calculada a taxa adiministrativa
        uint valorUsuario = valorDeposito - (valorDeposito * taxa / 100);
        
        //passa pelas carteiras de membros do contrato
        for (uint i = 0; i < carteira.length; i++) {
        
            // Verifica se a carteira do usurio corresponde ao endereo de quem chamou a funo
            if (carteira[i].carteiraUsuario == msg.sender) {
        
            // Adiciona os fundos a carteira do suario, tirando a taxa adiministrativa e a tranferindo para a Coover
            carteira[i].saldo += valorUsuario;
            fundosAdm += valorDeposito - valorUsuario;
            
            // Sai do loop
            break;
            }
        }
    }
    
    // Funo para ver o saldo da carteira que est chamando a funo
    // Exemplo: um usurio quer ver no front, o saldo da carteira dele, ele poder visualizar o saldo da carteira dele, 
    // pois a funo ir verificar se o endereo da carteira que est chamando a funo  igual ao endereo da carteira do usurio 
    function verSaldo() external view returns(uint){
        for (uint i = 0; i < carteira.length; i++) {
        
            // Verifica se a carteira do usurio corresponde ao endereo fornecido
            if (carteira[i].carteiraUsuario == msg.sender) {
        
            // Retorna o saldo do suario
            return carteira[i].saldo;
            
            // Sai do loop
            break;
            }
        }
    }
    
    // Funo para ver quanto de dinheiro tem no contrato, em suma, visualizar o saldo do contrato.
    function contratoSaldo() public view returns (uint) {
    uint balance = address(this).balance; // retorna quanto de fundo o contrato possui
    return  balance;
    }
    
    // referente a user storie 6, o cdigo abaixo, supre parte da user stories de nmero 6, pois ao criar uma funo que permita visualizar carteiras que fazem parte do contrato,
    //  um passo essencial para permitir que o usurio possa visualizar as pessoas que fazem parte de seu contrato, assim como previsto pela user storie
    // funo que permite visualizar carteiras participantes do contrato
    function visualizarCarteiras() public view returns (Carteira[] memory) {
        return carteira;
    }
    
    // Funo para ver o saldo do administrador do contrato
    function verSaldoAdm() external view returns(uint){
        return fundosAdm;
    }

    // Funo para o administrador conseguir retirar taxas do contrato (retirar o valor que o administrador ganha, o qual j estar destinado a ele)
    function retirarTaxas(uint256 quantidade) public apenasAdmin{
        
        //confere se o contrato tem dinheiro suficiente
        require(address(this).balance >= quantidade, "Saldo insuficiente no contrato");
        
        //trafere o valor j "separado" das taxas cobradas para o adiministrador, quando chama esta funo
        payable(msg.sender).transfer(quantidade);
    }

    //referente a user storie de nmero 10, o cdigo abaixo, supre parte da user stories de nmero 10, pois ao realizar a criao de uma funo que transfira dinheiro
    //do fundo do smartcontract para outra carteira, gera a possibilidade do gestor de seguros realizar a transferncia de uma indenizao a um membro do contrato
    //assim como previsto pela user storie
    //funo para tranferir idenizao a um suario
    // Funo para o administrador conseguir fornecer a indenizao a um membro do contrato
    function indenizar(address _indenizado,uint256 valorIndenizacao) public apenasAdmin{
    
        //confere se o contrato tem dinheiro suficiente
        require(address(this).balance >= valorIndenizacao, "Saldo insuficiente no contrato");
        
        //calcula quantos % do valor total dos aparelhos assegurados, a retirada representa
        uint valorTotalAssegurado = 0;
        
        // passa pelas carteiras do contrato e soma o valor total dos aparelhos assegurados
        for (uint i = 0; i < carteira.length; i++){ 
            valorTotalAssegurado += carteira[i].valorAparelho;
        }

        //calcula quanto deve ser retirado do saldo de cada usuario em %, do saldo de cada participante.
        uint valorDecrecido = valorIndenizacao / valorTotalAssegurado;
        
        //trafere o dinheiro para quem vai ser indenizado e diminui o valor relativo ao aparelho de cada usurio
        for (uint i = 0; i < carteira.length; i++){
            if (carteira[i].carteiraUsuario == _indenizado) {
                payable(_indenizado).transfer(valorIndenizacao);
                for (uint i = 0; i < carteira.length; i++){
                    carteira[i].saldo = carteira[i].saldo - (carteira[i].valorAparelho * valorDecrecido);
                }
            }
        }
    }

    // Funo para remover um usurio do projeto
    function removerUsuario(address _usuario) public apenasAdmin {
        
        // Verifica cada carteira do projeto
        for (uint i = 0; i < carteira.length; i++) {
            
            // Verifica se a carteira do usurio corresponde ao endereo fornecido
            if (carteira[i].carteiraUsuario == _usuario) {
            
            // Remove o usurio da lista de carteiras
            delete carteira[i];
            
            // Atualiza o nmero de usurios
            quantUsuario--;
            
                // Sai do loop
                break;
            }
        }
    }
    
    // corresponde user storie 8, o cdigo abaixo, supre parte da user stories de nmero 8, pois ao criar condies que verificam se o contrato est vlido e
    // se possui o nmero necessrio de pessoas para continuar, pode ser usado para garantir que o contrato s seja executado caso atenda as condies para ser iniciado
    // Verifica a viabilidade do contrato
    function viabilidadeContrato() public view returns (uint) {
        
        //Verifica se o contrato est vlido mas no possui o nmero ideal de pessoas para funcionar
        if (quantUsuario >= minPessoas  && quantUsuario <= maxPessoas) {
            return 1; // Contrato Ativo
            
        //Verifica se o contrato est vlido mas no possui o nmero de pessoas ideal para funcionar
        } else if (quantUsuario < minPessoas || quantUsuario >= maxPessoas) {
            return 2; // Contrato em Progresso        
        } else {
            revert("Erro ao verificar o contrato");
        }
    }
